//Realiza chute inicial para as variáveis zeta e theta
void FlexibleSECylinder_1::InitialGuess(Matrix* xS, double** convective, int n_solutions)
{
	Matrix bA = 0.5*(*x_AAi + *x_BAi);
	Matrix tA = 0.5*(*x_BAi - *x_AAi);
	double csi;
	csi = dot(*xS - bA, tA) / dot(tA,tA);
	Matrix Q_Acsi = (*Q_AAi)*(0.5 - 0.5*csi) + (*Q_BAi)*(0.5 + 0.5*csi);				//Tensor rotação no csiA
	Matrix x_Acsi = (*x_AAi)*(0.5 - 0.5*csi) + (*x_BAi)*(0.5 + 0.5*csi);				//Posição da projeção na reta
	
	//Vetor e1_A atualizado (em csi)
	Matrix e1_A(3);
	e1_A(0, 0) = 1.0;
	Matrix e2_A(3);
	e2_A(1, 0) = 1.0;
	e1_A = Q_Acsi*e1_A;
	e2_A = Q_Acsi*e2_A;
	
	//Estimativa dos theta_A e theta_B
	double theta = 0;
	Matrix xSxA = *xS - x_Acsi;
	double distance = norm(xSxA);
	
	if (distance != 0.0)
	{
		double cos_e1_A = dot(xSxA, e1_A) / distance;
		double cos_e2_A = dot(xSxA, e2_A) / distance;
		//Evitando erros de arredondamento - cos
		if (cos_e1_A > 1.0)
			cos_e1_A = 1.0;
		if (cos_e1_A < -1.0)
			cos_e1_A = -1.0;
		if (cos_e2_A > 1.0)
			cos_e2_A = 1.0;
		if (cos_e2_A < -1.0)
			cos_e2_A = -1.0;
		//Primeiro ou quarto quadrantes
		if (cos_e1_A >= 0.0)
		{
			if (cos_e2_A >= 0.0)//primeiro
				theta = abs(acos(cos_e1_A));
			else //quarto
				theta = -abs(acos(cos_e1_A));
		}
		//Segundo ou terceiro quadrantes
		else
		{
			if (cos_e2_A >= 0.0)//segundo
				theta = abs(acos(cos_e2_A)) + PI / 2;
			else //terceiro
				theta = abs(acos(-cos_e1_A)) + PI;
		}
	}
	//Salva nas variáveis - solução principal
	convective[0][0] = csi;
	convective[0][1] = theta;
	//Salva nas variáveis - soluções secundárias
	for (int i = 1; i < n_solutions; i++)
	{
		convective[i][0] = csi;
		convective[i][1] = theta + PI;
	}
}

void FlexibleSECylinder_1::PreCalc()
{
	//Apontando para posição que indica valor dos GLs globais
	for (int i = 0; i < 6; i++)
	{
		GLs[i] = &db.nodes[nodes[0] - 1]->GLs[i];
		GLs[i + 6] = &db.nodes[nodes[1] - 1]->GLs[i];
	}
	e = 2.0 / n;	//expoente

	//Transformação de coordenadas
	Matrix e1g(3);
	e1g(0, 0) = 1.0;
	Matrix e2g(3);
	e2g(1, 0) = 1.0;
	Matrix e3g(3);
	e3g(2, 0) = 1.0;
	Matrix e1l = *db.CS[csA - 1]->E1;
	Matrix e2l = *db.CS[csA - 1]->E2;
	Matrix e3l = *db.CS[csA - 1]->E3;

	//Salva a matriz de transformação de coordenadas (para orientar o plano da ST de acordo com a orientação de referência da superfície)
	(*Q0A)(0, 0) = dot(e1g, e1l);
	(*Q0A)(0, 1) = dot(e1g, e2l);
	(*Q0A)(0, 2) = dot(e1g, e3l);

	(*Q0A)(1, 0) = dot(e2g, e1l);
	(*Q0A)(1, 1) = dot(e2g, e2l);
	(*Q0A)(1, 2) = dot(e2g, e3l);

	(*Q0A)(2, 0) = dot(e3g, e1l);
	(*Q0A)(2, 1) = dot(e3g, e2l);
	(*Q0A)(2, 2) = dot(e3g, e3l);

	e1l = *db.CS[csB - 1]->E1;
	e2l = *db.CS[csB - 1]->E2;
	e3l = *db.CS[csB - 1]->E3;

	//Salva a matriz de transformação de coordenadas (para orientar o plano da ST de acordo com a orientação de referência da superfície)
	(*Q0B)(0, 0) = dot(e1g, e1l);
	(*Q0B)(0, 1) = dot(e1g, e2l);
	(*Q0B)(0, 2) = dot(e1g, e3l);

	(*Q0B)(1, 0) = dot(e2g, e1l);
	(*Q0B)(1, 1) = dot(e2g, e2l);
	(*Q0B)(1, 2) = dot(e2g, e3l);

	(*Q0B)(2, 0) = dot(e3g, e1l);
	(*Q0B)(2, 1) = dot(e3g, e2l);
	(*Q0B)(2, 2) = dot(e3g, e3l);

	SaveConfiguration();

	DegenerationPreCalc();
}

